import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Row, Col, FormGroup, Label, Input , UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem , Button} from "reactstrap";

class App extends React.Component{
  render() {
    return (
      <div className="App">
        <header className = "App-header">
          <Row className = "App-row">
            <Col>
              <Label>Username : </Label>
            </Col>
            <Col>
              <Input></Input>
            </Col>
            <Col>
              <Button>Submit</Button>
            </Col>
          </Row>
        </header>

        <body className = "App-body">
          <Row>
            <Col>
              <h2>User Profile</h2>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Location : </Label>
            </Col>
            <Col>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Email : </Label>
            </Col>
            <Col>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Bio : </Label>
            </Col>
            <Col>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Profile link : </Label>
            </Col>
            <Col>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Total Number of Starred Repo's : </Label>
            </Col>
            <Col>
              <Label></Label>
            </Col>
          </Row>

          <Row className = "App-row">
            <Col>
              <Label>Followers : </Label>
            </Col>
            <Col>
              <Label></Label>
            </Col>
          </Row>

        </body>
      </div>
    );
  }
}
